import {Component, OnInit} from '@angular/core';
import {FormBuilder, FormGroup, Validators} from "@angular/forms";
import {ActivatedRoute, Router} from "@angular/router";
import {PeopleManagementService} from "../../../../../../../fe-common-v2/src/lib/services/people-management.service";
import {MCPHelperService} from "../../../../service/MCPHelper.service";
import {TranslateService} from "@ngx-translate/core";
import {AngularEditorConfig} from "@kolkov/angular-editor";
import swal from "sweetalert2";
import {EventManagementSettingService} from "../../../../../../../fe-common-v2/src/lib/services/event-management-setting.service";
import {SharedDataService} from "../../event-setting/shared-data.service";

@Component({
    selector: 'app-edit-email-template',
    templateUrl: './edit-email-template.component.html',
    styleUrls: ['./edit-email-template.component.scss']
})
export class EditEmailTemplateComponent implements OnInit {
    emailUpdateForm: FormGroup;
    primaryColor: any
    config: AngularEditorConfig = {
        editable: true,
        spellcheck: true,
        height: '24rem',
        minHeight: '4rem',
        sanitize: false,
        // placeholder: this.translate.instant('PEOPLE_MANAGEMENT.Enter text here'),
        translate: 'no',
        defaultParagraphSeparator: 'p',
        fonts: [
            {class: 'garamond', name: 'Garamond'},
            {class: 'arial', name: 'Arial'},
            {class: 'times-new-roman', name: 'Times New Roman'},
            {class: 'calibri', name: 'Calibri'},
            {class: 'comic-sans-ms', name: 'Comic Sans MS'}
        ],
        defaultFontName: 'Arial',
        toolbarHiddenButtons: [
            ['insertImage'],
            ['insertVideo']
        ],
        customClasses: [
            {
                name: 'LineHeight-15px',
                class: 'LineHeight-15px',
            },
            {
                name: 'LineHeight-20px',
                class: 'LineHeight-20px',
            },
            {
                name: 'LineHeight-25px',
                class: 'LineHeight-25px',
            },
            {
                name: 'LineHeight-30px',
                class: 'LineHeight-30px',
            },
            {
                name: 'Text-justify',
                class: 'Text-justify',
            }
        ],
    };
    sharedData: any;
    panelOpenState = false;

    constructor(
        private _formBuilder: FormBuilder,
        private router: Router,
        public route: ActivatedRoute,
        private ApiService: EventManagementSettingService,
        private helper: MCPHelperService,
        public translate: TranslateService,
        public sharedService: SharedDataService) {
        this.emailUpdateForm = this._formBuilder.group({
            id: [''],
            template: [''],
            subject: ['', Validators.required],
        });

    }

    ngOnInit(): void {
        this.sharedService.sharedData$.subscribe((sharedData: any) => {
            this.sharedData = sharedData
        });
        this.ApiService.getListForGeneralSettings({}).subscribe((data: any) => {
            const documentData = data.data;
            this.primaryColor = documentData?.emailTemplateColor ? documentData?.emailTemplateColor : "#003045";
            // this.emailUpdateForm.controls['description'].setValue(this.sharedData.template);
            this.emailUpdateForm.controls['id'].setValue(this.sharedData?.id);
            this.emailUpdateForm.controls['subject'].setValue(this.sharedData?.subject);
        });

    }

    clearData() {
        this.sharedService.setData(null);
    }

    updateEmailTemplate() {
        var re = /#002A3A/gi;
        var re2 = /#003045/gi;
        var reWith = this.primaryColor;
        var re3 = /size="2"/gi;
        //var reWithFont = /size="2" style="font-size:12px"/gi;
        var reWithFont = 'size="2" style="font-size:12px"';
        var checkDuplicateFont = 'style="font-size:12px" style="font-size:12px"';
        var removeDuplicateFont = 'style="font-size:12px"';
        /*var mailAuth = 'Team Legance';
        var mailAuthNew = 'Team Formazione Legance';*/
        const getTemplate = this.emailUpdateForm.value.template;
        let getTemplate2 = getTemplate.replace(re, reWith);
        getTemplate2 = getTemplate2.replace(re2, reWith);
        getTemplate2 = getTemplate2.replace(re3, reWithFont);
        getTemplate2 = getTemplate2.replace(checkDuplicateFont, removeDuplicateFont);
        //getTemplate2 = getTemplate2.replace(mailAuth, mailAuthNew);
        const addFonts = "<style>*{font-size: inherit;}@font-face{font-family:'Garamond';src:url(data:application/x-font-woff;charset=utf-8;base64,) format('woff2'),url(data:application/x-font-woff;charset=utf-8;base64,) format('woff');font-weight:400;font-style:normal;}@font-face{font-family:'Garamond';src:url(data:application/x-font-woff;charset=utf-8;base64,) format('woff2'),url(data:application/x-font-woff;charset=utf-8;base64,) format('woff');font-weight:700;font-style:normal;}"
        if (getTemplate2.indexOf('@font-face') >= 0) {
            getTemplate2 = getTemplate2.replace("<style><style>", '<style>');
        } else {
            getTemplate2 = getTemplate2.replace("<style><style>", '<style>');
            getTemplate2 = getTemplate2.replace("<style>", addFonts);
        }
        if (getTemplate2.indexOf('*{font-size') >= 0) {
            getTemplate2 = getTemplate2.replace("<style><style>", '<style>');
        } else {
            getTemplate2 = getTemplate2.replace("<style><style>", '<style>');
            getTemplate2 = getTemplate2.replace("<style>", '<style>*{font-size: inherit;}');
        }


        this.emailUpdateForm.value.template = getTemplate2;
        this.ApiService.updateEmailTemplate(this.emailUpdateForm.value).subscribe((res: any) => {
            if (res.statusCode === 200) {
                this.helper.toggleLoaderVisibility(false);
                swal.fire(
                    '',
                    this.translate.instant(res.meta.message),
                    'success'
                )
                this.sharedService.setData(null);
            }
            this.helper.toggleLoaderVisibility(false);
        }, (err) => {
            this.helper.toggleLoaderVisibility(false);
            swal.fire(
                '',
                this.translate.instant(err.error.message),
                'info'
            )
        });
    }
}
